import React from 'react';
// import { CDate } from './CurrentDate';
import Greet from './Greet';
import {CTime , CDate} from './CurrentDateTime';
// import Ctime from './CurrentTime';

function App(){

    return(
        <>
    <Greet/>
    {CDate()}
    <CTime/>
  </>
    )

}


export default App;
